infrastructure/modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block = var.vpc_cidr

  tags = {
    Name = "main-vpc"
  }
}

resource "aws_subnet" "public" {
  vpc_id            = aws_vpc.main.id
  cidr_block        = var.public_subnet_cidr
  map_public_ip_on_launch = true

  tags = {
    Name = "public-subnet"
  }
}

resource "aws_subnet" "private" {
  vpc_id            = aws_vpc.main.id
  cidr_block        = var.private_subnet_cidr
  map_public_ip_on_launch = false

  tags = {
    Name = "private-subnet"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "main-gateway"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    Name = "public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  subnet_id      = aws_subnet.public.id
  route_table_id = aws_route_table.public.id
}

infrastructure/modules/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "The CIDR block for the VPC"
  type        = string
  default     = "10.0.0.0/16"
}

variable "public_subnet_cidr" {
  description = "The CIDR block for the public subnet"
  type        = string
  default     = "10.0.1.0/24"
}

variable "private_subnet_cidr" {
  description = "The CIDR block for the private subnet"
  type        = string
  default     = "10.0.2.0/24"
}

infrastructure/modules/vpc/outputs.tf.code:
output "vpc_id" {
  value = aws_vpc.main.id
}

output "public_subnet_id" {
  value = aws_subnet.public.id
}

output "private_subnet_id" {
  value = aws_subnet.private.id
}

output "internet_gateway_id" {
  value = aws_internet_gateway.gw.id
}

infrastructure/modules/ec2/main.tf.code:
resource "aws_launch_configuration" "lc" {
  name_prefix   = "lc-"
  image_id      = var.image_id
  instance_type = var.instance_type
  user_data     = file("${path.module}/user_data.sh")

  lifecycle {
    create_before_destroy = true
  }

  security_groups = [aws_security_group.sg.id]
}

resource "aws_autoscaling_group" "asg" {
  launch_configuration    = aws_launch_configuration.lc.id
  vpc_zone_identifier     = var.subnets
  min_size                = var.asg_min_size
  max_size                = var.asg_max_size
  desired_capacity        = var.asg_desired_capacity
  health_check_type       = "EC2"
  force_delete            = true
  wait_for_capacity_timeout = "0"

  tag {
    key                 = "Name"
    value               = "ec2-instance"
    propagate_at_launch = true
  }

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_security_group" "sg" {
  name_prefix = "sg-"
  description = "Security group for the application"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = var.app_port
    to_port     = var.app_port
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_alb" "alb" {
  name_prefix   = "alb-"
  subnets       = var.subnets
  security_groups = [aws_security_group.sg.id]

  tags = {
    Name = "alb"
  }
}

resource "aws_alb_target_group" "tg" {
  name_prefix   = "tg-"
  port          = var.app_port
  protocol      = "HTTP"
  vpc_id        = var.vpc_id

  health_check {
    path                = var.health_check_path
    protocol            = "HTTP"
    healthy_threshold   = 2
    unhealthy_threshold = 2
    timeout             = 5
    interval            = 30
    matcher             = "200"
  }
}

resource "aws_alb_listener" "front_end" {
  load_balancer_arn = aws_alb.alb.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.tg.arn
  }
}

infrastructure/modules/ec2/variables.tf.code:
variable "vpc_id" {
  description = "The VPC ID where resources will be created"
  type        = string
}

variable "subnets" {
  description = "The subnets for the Autoscaling group and ALB"
  type        = list(string)
}

variable "image_id" {
  description = "The AMI to use for the instance"
  type        = string
}

variable "instance_type" {
  description = "The type of instance to start"
  type        = string
}

variable "app_port" {
  description = "The port on which the application will run"
  type        = number
}

variable "asg_min_size" {
  description = "The minimum size of the autoscaling group"
  type        = number
}

variable "asg_max_size" {
  description = "The maximum size of the autoscaling group"
  type        = number
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the autoscaling group"
  type        = number
}

variable "health_check_path" {
  description = "The health check path for the load balancer"
  type        = string
  default     = "/"
}

infrastructure/modules/ec2/outputs.tf.code:
output "asg_name" {
  value = aws_autoscaling_group.asg.name
}

output "alb_dns_name" {
  value = aws_alb.alb.dns_name
}

output "alb_target_group_arn" {
  value = aws_alb_target_group.tg.arn
}

output "sg_id" {
  value = aws_security_group.sg.id
}
